import React from "react";

export default function SignUp() {
    return (
        <div className='sign-up-container'>
            <form>
                <h1>Sign Up</h1>

                <div className='form-item-container'>
                    <p>Username</p>
                    <input type='text' placeholder='Enter username' />
                </div>
            </form>
        </div>
    )
}
